import React from 'react';
import './Projects.css';

function Projects() {
  return (
    <section id="projects">
      <h2>My Projects</h2>
      <div className="projects-container">
        <div className="project">
          <h3>Project 1</h3>
          <p>Description of project 1.</p>
        </div>
        <div className="project">
          <h3>Project 2</h3>
          <p>Description of project 2.</p>
        </div>
        {/* Add more projects as needed */}
      </div>
    </section>
  );
}

export default Projects;
